import React from 'react';
import Donut from 'react-donut';

const Chart = () => {
	return (
		<div className="App">
			<Donut
				chartData={[
					{ name: 'Black Panther', data: 30 },
					{ name: 'Avengers', data: 50 },
					{ name: 'Antman', data: 20 },
				]}
				chartWidth={300}
				chartHeight={500}
				showChartLabel={true}
				chartThemeConfig={{
					chart: {
						background: 'transparent',
					},
					series: {
						colors: ['#ffe0bd', '#670303', '#6cbfce'],
					},
					chartExportMenu: {
						visibility: 'none',
					},
				}}
			/>
		</div>
	);
};

export default Chart;
